for (var j=0; j<n; j++) {
  var row=-1, mind=-1;
  
  for (var i=j; i<m; i++) {
    var d = abs(A[i*m+j]);
    
    if (d > mind) {
      mind = d;
      row = i;
    }
  }
  
  if (row == -1) continue;
  
  console.log(row, j);
  
  swaprow(A, row, j);
  swaprow(I, row, j);
  
  var x = 1.0/A[j*m+j];
  if (x == undefined) continue;
  
  for (var i=0; i<m; i++) {
    A[j*m+i]       *= x;
    I[j*m+(m-i-1)] *= x;
  }
  
  var x1 = A[j*m+j];
  
  for (var i=m-1; i >= 0; i--) {
    if (j == i) continue;
    
    var x = A[i*m+j];
    if (x == 0.0) continue;
    
    x = x/x1;
    
    for (var k=0; k<m; k++) {
      A[i*m+k] -= A[j*m+k]*x;
      I[i*m+k] -= I[j*m+k]*x;
    }
  }
}

this.load(I);
return this;
